import React from 'react'

function Menu() {

    function handleClick(e) {
        e.preventDefault();
        console.log('По ссылке кликнули.');
      }
      
    return(
            <div className="menu-block">
                    <div className="menu-item">
                        Главная
                    </div>
                    <div className="menu-item">
                        О продуктах
                    </div>
                    <div className="menu-item">
                        <button onClick={handleClick}>Выйти</button>
                    </div>
            </div>
    )
}

export default Menu
